import{_ as e,o as t,c as i,Q as a}from"./chunks/framework.50d670e8.js";const m=JSON.parse('{"title":"Succeedium Planning Analytics Cloud Extension End-User License Agreement (E.U.L.A.)","description":"","frontmatter":{},"headers":[],"relativePath":"eula.md","filePath":"eula.md"}'),o={name:"eula.md"},n=a('<h1 id="succeedium-planning-analytics-cloud-extension-end-user-license-agreement-e-u-l-a" tabindex="-1">Succeedium Planning Analytics Cloud Extension End-User License Agreement (E.U.L.A.) <a class="header-anchor" href="#succeedium-planning-analytics-cloud-extension-end-user-license-agreement-e-u-l-a" aria-label="Permalink to &quot;Succeedium Planning Analytics Cloud Extension End-User License Agreement (E.U.L.A.)&quot;">​</a></h1><p><em>Last updated: Sep 3, 2023</em></p><p>Thanks for using Succeedium Planning Analytics Cloud Extension (<strong>“SPACE”</strong>). This license agreement (<strong>“Agreement”</strong>) describes your rights and responsibilities as a customer of SPACE. This agreement is between you and Succeedium that owns and operates the SPACE that you are using or accessing listed here, also (<strong>“we”</strong> or <strong>“us”</strong>). <strong>“You”</strong> means the entity you represent in accepting this agreement or, if that does not apply, you individually. If you are accepting on behalf of your employer or another entity, you represent and warrant that: (i) you have full legal authority to bind your employer or such entity to this agreement; (ii) you have read and understand this agreement; and (iii) you agree to this agreement on behalf of the party that you represent.</p><p>This agreement is effective as of the date you first click “I agree” (or similar button or checkbox) or use or access SPACE, whichever is earlier (the <strong>“Effective Date”</strong>). This agreement does not have to be signed in order to be binding. You indicate your assent to this agreement, to our privacy policy (<a href="https://succeedium.com/space/privacy" target="_blank" rel="noreferrer">https://succeedium.com/space/privacy</a>) and the terms of service (<a href="https://succeedium.com/space/terms" target="_blank" rel="noreferrer">https://succeedium.com/space/terms</a>) by placing an Order or using SPACE.</p><h2 id="_1-definitions" tabindex="-1">1. Definitions. <a class="header-anchor" href="#_1-definitions" aria-label="Permalink to &quot;1. Definitions.&quot;">​</a></h2><p>Certain capitalized terms are defined in this Section 1, and others are defined contextually in this agreement.</p><p><strong>“Additional Services”</strong> includes Consultations, Training or other services related to SPACE we provide to you, as identified in an Order. For the avoidance of doubt, Additional Services do not include the standard level of support included in your subscription.</p><p><strong>“Affiliate”</strong> means an entity which, directly or indirectly, owns or controls, is owned or is controlled by or is under common ownership or control with a party, where “control” means the power to direct the management or affairs of an entity, and “ownership” means the beneficial ownership of greater than 50% of the voting equity securities or other equivalent voting interests of the entity.</p><p><strong>“Consultation”</strong> means a service where we analyze your non-SPACE related issues and help you solve or workaround them.</p><p><strong>“Documentation”</strong> means our standard published documentation for SPACE, currently located here: <a href="https://succeedium.com/space/doc" target="_blank" rel="noreferrer">https://succeedium.com/space/doc</a></p><p><strong>“End User”</strong> means an individual you or an Affiliate permits or invites to use SPACE. For the avoidance of doubt: (a) individuals invited by your End Users, (b) individuals under managed accounts, and (c) individuals interacting with SPACE as your customer are also considered End Users.</p><p><strong>“End User Account”</strong> means an account established by you or an End User to enable the End User to use or access SPACE. We use email addresses and full name to define End User accounts.</p><p><strong>“Feedback”</strong> means comments, questions, ideas, suggestions or other feedback relating to SPACE, Support or Additional Services.</p><p><strong>“Laws”</strong> means all applicable local, provincial, state, federal and international laws, regulations and conventions, including those related to data privacy and data transfer, international communications and the exportation of technical or personal data.</p><p><strong>“Notification Email Address”</strong> means the email address(es) you used to purchase SPACE licenses. It is your responsibility to keep your email address(es) valid and current so that we are able to send notices, statements, and other information to you.</p><p><strong>“Order”</strong> means a document or process describing the products and services you are ordering from us and, as applicable, their permitted scope of use. As applicable, the Order will identify: (i) the number of End Users, Subscription Term, email addresses or domain(s) associated with your use of SPACE or other scope of use parameters, (iii) SPACE support details and (iv) the amount or rate you will be charged, the billing and renewal terms, applicable currency, and form of payment. Orders may also include Additional Services and Training.</p><p><strong>“Our Deliverables”</strong> means any materials, deliverables, modifications, derivative works or developments that we provide in connection with any Additional Services.</p><p><strong>“Our Policies”</strong> means our Terms of Use, Privacy Policy and (unless specified) any other policies or terms referenced in this agreement.</p><p><strong>“Our Technology”</strong> means SPACE, Our Deliverables, their “look and feel”, any and all related or underlying technology and any modifications or derivative works of the foregoing, including as they may incorporate Feedback.</p><p><strong>“PO”</strong> means a purchase order.</p><p><strong>“Sensitive Personal Information”</strong> means any (i) special categories of personal data enumerated in European Union Regulation 2016/679, Article 9(1) or any successor legislation; (ii) patient, medical or other protected health information regulated by the Health Insurance Portability and Accountability Act (in USA) or the Personal Information Protection and Electronic Documents Act (in Canada); (iii) credit, debit or other payment card data subject to the Payment Card Industry Data Security Standards; (iv) other personal information subject to regulation or protection under specific laws such as the Gramm-Leach-Bliley Act (or related rules or regulations); (v) social security numbers, driver’s license numbers or other government ID numbers; or (vi) any data similar to the foregoing that is protected under foreign or domestic laws or regulations.</p><p><strong>“Subscription Term”</strong> means your permitted subscription period for SPACE, as set forth in the applicable Order.</p><p><strong>“Support”</strong> means support for SPACE, as further described, it does not include any assistance with your other IT applications and systems.</p><p><strong>“Training”</strong> means SPACE training provided by us.</p><p><strong>“Your Data”</strong> means any data, content, code, video, images or other materials of any type that you (including any of your End Users) store in IBM Planning Analytics.</p><p><strong>“Your Materials”</strong> means your materials, systems, personnel or other resources.</p><h2 id="_2-what-this-agreement-covers" tabindex="-1">2. What this agreement covers. <a class="header-anchor" href="#_2-what-this-agreement-covers" aria-label="Permalink to &quot;2. What this agreement covers.&quot;">​</a></h2><p>2.1. This agreement governs SPACE, related Support, and Additional Services.</p><h2 id="_3-how-space-is-administered" tabindex="-1">3. How SPACE is administered. <a class="header-anchor" href="#_3-how-space-is-administered" aria-label="Permalink to &quot;3. How SPACE is administered.&quot;">​</a></h2><p>3.1. <span style="text-decoration:underline;">License accounts</span>. When you purchase SPACE server, it comes with 2 user licenses. Additional licenses can be purchased as needed.</p><p>3.2. <span style="text-decoration:underline;">Installation</span>. We will install and set up a dedicated SPACE server for you and will provide instructions on how to use it with IBM Planning Analytics Workspace.</p><p>3.3. <span style="text-decoration:underline;">License Usage</span>. You are responsible for ensuring that only the licensed users have access to SPACE.</p><p>3.4. <span style="text-decoration:underline;">Age Requirement for End Users</span>. SPACE is not intended for, and should not be used by, anyone under the age of 16. You are responsible for ensuring that all End Users are at least 16 years old.</p><h2 id="_4-what-s-included-in-your-space-subscription-what-are-the-restrictions" tabindex="-1">4. What&#39;s included in your SPACE subscription; what are the restrictions. <a class="header-anchor" href="#_4-what-s-included-in-your-space-subscription-what-are-the-restrictions" aria-label="Permalink to &quot;4. What&#39;s included in your SPACE subscription; what are the restrictions.&quot;">​</a></h2><p>4.1. <span style="text-decoration:underline;">Access to SPACE</span>. Subject to this agreement and SPACE terms of service (<a href="https://succeedium.com/space/terms" target="_blank" rel="noreferrer">https://succeedium.com/space/terms</a>) and during the applicable Subscription Term, you may access and use SPACE for your own business purposes or personal use, as applicable, all in accordance with this agreement, the applicable Order and the Documentation. This includes the right, as part of your authorized use of SPACE, to access and use the SPACE add-on. The rights granted to you in this Section 4.1 are non-exclusive, non-sublicensable and non-transferable.</p><p>4.2. <span style="text-decoration:underline;">Support</span>. During the Subscription Term, we will provide Support for SPACE in accordance with the applicable Order. The support response window varies depending on the purchased SPACE plan and the details are outlined in your Order.</p><p>4.3. <span style="text-decoration:underline;">Restrictions</span>. Except as otherwise expressly permitted in this agreement, you will not: (a) reproduce, modify, adapt or create derivative works of SPACE; (b) rent, lease, distribute, sell, sublicense, transfer or provide access to SPACE to a third party; (c) use SPACE for the benefit of any third party; (d) incorporate any SPACE functionality into a product or service you provide to a third party; (e) interfere with or otherwise circumvent mechanisms in SPACE to limit your use; (f) reverse engineer, disassemble, decompile, translate or otherwise seek to obtain or derive the source code, underlying ideas, algorithms except to the extent expressly permitted by applicable law (and then only upon advance notice to us); (g) remove or obscure any proprietary or other notices contained in SPACE; (h) use SPACE for competitive analysis or to build competitive products; (i) publicly disseminate information regarding the performance of SPACE; or (j) encourage or assist any third party to do any of the foregoing.</p><h2 id="_5-our-security-and-data-privacy-policies" tabindex="-1">5. Our security and data privacy policies. <a class="header-anchor" href="#_5-our-security-and-data-privacy-policies" aria-label="Permalink to &quot;5. Our security and data privacy policies.&quot;">​</a></h2><p>5.1. <span style="text-decoration:underline;">Security</span>. We implement and maintain physical, technical and administrative security measures designed to protect Your Data from unauthorized access, destruction, use, modification, or disclosure.</p><p>5.2. <span style="text-decoration:underline;">Privacy</span>. We collect certain data and information about you and your End Users in connection with your and your End Users’ use of SPACE and otherwise in connection with this agreement. We collect and use all such data and information in accordance with our Privacy Policy (<a href="https://succeedium.com/space/privacy" target="_blank" rel="noreferrer">https://succeedium.com/space/privacy</a>), which you acknowledge.</p><p>5.3. <span style="text-decoration:underline;">Your email and names</span>. We collect your email address and full name to communicate any important messages, like updates to our policies. We may also collect information from you when you contact us by email or use our support desk system. Your information, whether public or private, will not be sold, exchanged, transferred, or given to any other company for any reason whatsoever.</p><p>5.4. <span style="text-decoration:underline;">Your Data in IBM Planning Analytics</span>. The data you stored in IBM Planning Analytics is private to you. Succeedium employees have no access to your data.</p><p>5.5. <span style="text-decoration:underline;">Subpoenas</span>. Nothing in this agreement prevents us from disclosing Your Data to the extent required by law, subpoenas or court orders, but we will use commercially reasonable efforts to notify you where permitted to do so.</p><p>5.6. <span style="text-decoration:underline;">GDPR Data Processing Addendum</span>. If you are in the EEAU, Switzerland, or are otherwise subject to the territorial scope of Regulation (EU) 2016/679 (General Data Protection Regulation) or any successor legislation, you can contact us (<a href="mailto:info@succeedium.com" target="_blank" rel="noreferrer">info@succeedium.com</a>) and request to complete SPACE Data Processing Addendum.</p><h2 id="_6-using-third-party-products-with-space" tabindex="-1">6. Using third-party products with SPACE. <a class="header-anchor" href="#_6-using-third-party-products-with-space" aria-label="Permalink to &quot;6. Using third-party products with SPACE.&quot;">​</a></h2><p>6.1. <span style="text-decoration:underline;">Third-Party Products</span>. You (including your End Users) may choose to use or procure other third party products or services in connection with IIBM Planning Analytics, including other integrations (see Section 6.2 (Other integrations)) or other code (see Section 6.3 (Other code)). Your receipt or use of any third party products or services (and the third parties’ use of any of Your Data) is subject to a separate agreement between you and the third party provider. You are solely responsible for your decision to permit any third party provider or third party product or service to use Your Data. It is your responsibility to carefully review the agreement between you and the third party provider, as provided by the applicable third party provider. WE DISCLAIM ALL LIABILITY AND RESPONSIBILITY FOR ANY THIRD PARTY PRODUCTS OR SERVICES (WHETHER SUPPORT, AVAILABILITY, SECURITY OR OTHERWISE) OR FOR THE ACTS OR OMISSIONS OF ANY THIRD PARTY PROVIDERS OR VENDORS.</p><p>6.2. <span style="text-decoration:underline;">Other integrations</span>. You may integrate IBM Planning Analytics with other products or services. All other products or services are subject to their own applicable vendor terms.</p><p>6.3. <span style="text-decoration:underline;">Other code</span>. You may use TM1 Turbointegrator Processes or Scripts to add additional functionality to Google Sheets. It is your responsibility to make sure those processes are safe to use and you comply with any policies and terms related to the used scripts.</p><h2 id="_7-additional-services" tabindex="-1">7. Additional Services. <a class="header-anchor" href="#_7-additional-services" aria-label="Permalink to &quot;7. Additional Services.&quot;">​</a></h2><p>7.1. <span style="text-decoration:underline;">Additional Services</span>. Subject to this agreement, you may purchase Additional Services (consultation or training) that we will provide to you pursuant to the applicable Order.</p><p>7.2. <span style="text-decoration:underline;">Your Materials</span>. You agree to provide us with reasonable access to Your Materials as reasonably necessary for our provision of Additional Services. If you do not provide us with timely access to Your Materials, our performance of Additional Services will be excused until you do so. You retain your rights in Your Materials. We will use Your Materials solely for purposes of performing the Additional Services. You represent and warrant that you have all necessary rights in Your Materials to provide them to us for such purposes.</p><p>7.3. <span style="text-decoration:underline;">Consultation</span>. Your purchase, and our provision, of Consultation is subject to this agreement.</p><p>7.4. <span style="text-decoration:underline;">Training</span>. Your purchase, and our provision, of Training is subject to this agreement.</p><h2 id="_8-billing-renewals-and-payment" tabindex="-1">8. Billing, renewals, and payment. <a class="header-anchor" href="#_8-billing-renewals-and-payment" aria-label="Permalink to &quot;8. Billing, renewals, and payment.&quot;">​</a></h2><p>8.1. <span style="text-decoration:underline;">Annual Plans</span>. Except for trial periods and no-charge products, all SPACE plans are offered on an annual subscription basis.</p><p>8.2. <span style="text-decoration:underline;">Renewals</span>. Except as otherwise specified in your Order, unless either party cancels your subscription prior to expiration of the current Subscription Term, your subscription will automatically renew for another Subscription Term of a period equal to your initial Subscription Term. You will provide any notice of non-renewal through contacting our support team (<a href="mailto:SPACE@succeedium.com" target="_blank" rel="noreferrer">SPACE@succeedium.com</a>). Canceling your subscription means that you will not be charged for the next billing cycle, but you will not receive any refunds or credits for amounts that have already been charged. All renewals will be charged at the then-current rates.</p><p>8.3. <span style="text-decoration:underline;">Payment</span>. You will pay all fees in accordance with each Order, by the due dates and in the currency specified in the Order. For Additional Services provided at your location, unless otherwise specified in your Order, you will reimburse us for our pre-approved travel, lodging and meal expenses, which we may charge as incurred. All amounts are non-refundable, non-cancelable and non-creditable. If applicable you agree that we may bill your credit card or other payment method for renewals or additional services.</p><p>8.4. <span style="text-decoration:underline;">Delivery</span>. All deliveries under this agreement will be electronic. We will use the email address provided by you.</p><h2 id="_9-our-return-policy" tabindex="-1">9. Our return policy. <a class="header-anchor" href="#_9-our-return-policy" aria-label="Permalink to &quot;9. Our return policy.&quot;">​</a></h2><p>9.1. <span style="text-decoration:underline;">SPACE demo</span>Before purchasing a license, our demo session will give you the opportunity to clarify any questions or expectations you may have.</p><p>9.2. <span style="text-decoration:underline;">No refund policy</span>. We provide no refunds on paid orders, including subscription fees and additional services.</p><h2 id="_10-taxes" tabindex="-1">10. Taxes. <a class="header-anchor" href="#_10-taxes" aria-label="Permalink to &quot;10. Taxes.&quot;">​</a></h2><p>10.1. <span style="text-decoration:underline;">Taxes</span>. Your fees under this agreement exclude any taxes or duties payable in respect of your order in the jurisdiction where the payment is either made or received. To the extent that any such taxes or duties are payable by us, you must pay to us the amount of such taxes or duties in addition to any fees owed under this agreement. Notwithstanding the foregoing, if you have obtained an exemption from relevant taxes or duties as of the time such taxes or duties are levied or assessed, you may provide us with such exemption information, and we will use reasonable efforts to provide you with invoicing documents designed to enable you to obtain a refund or credit from the relevant revenue authority, if such a refund or credit is available.</p><p>10.2. <span style="text-decoration:underline;">Withholding Taxes</span>. You will pay all fees net of any applicable withholding taxes. You and we will work together to avoid any withholding tax if exemptions, or a reduced treaty withholding rate, are available. If we qualify for a tax exemption, or a reduced treaty withholding rate, we will provide you with reasonable documentary proof. You will provide us reasonable evidence that you have paid the relevant authority for the sum withheld or deducted.</p><h2 id="_11-purchasing-through-a-reseller" tabindex="-1">11. Purchasing through a Reseller. <a class="header-anchor" href="#_11-purchasing-through-a-reseller" aria-label="Permalink to &quot;11. Purchasing through a Reseller.&quot;">​</a></h2><p>10.1. If you make any purchases through an authorized partner or reseller of SPACE (“Reseller”):</p><p>(a) Instead of paying us, you will pay the applicable amounts to the Reseller, as agreed between you and the Reseller. We may suspend or terminate your rights to use SPACE if we do not receive the corresponding payment from the Reseller.</p><p>(b) Your order details (contact information, the subscription terms, etc.) will be as stated in the Order placed with us by the Reseller on your behalf, and the Reseller is responsible for the accuracy of any such Order as communicated to us.</p><p>(c) Resellers are not authorized to modify this agreement or make any promises or commitments on our behalf, and we are not bound by any obligations to you other than as set forth in this agreement.</p><h2 id="_12-ip-rights" tabindex="-1">12. IP Rights. <a class="header-anchor" href="#_12-ip-rights" aria-label="Permalink to &quot;12. IP Rights.&quot;">​</a></h2><p>12.1. <span style="text-decoration:underline;">IP Rights and Feedback</span>. SPACE is made available on a limited access basis, and no ownership right is conveyed to you, irrespective of the use of terms such as “purchase” or “sale”. We and our licensors have and retain all right, title and interest, including all intellectual property rights, in and to Our Technology. From time to time, you may choose to submit Feedback to us. We may in connection with any of our products or services freely use, copy, disclose, license, distribute and exploit any Feedback in any manner without any obligation, royalty or restriction based on intellectual property rights or otherwise. No Feedback will be considered your Confidential Information, and nothing in this agreement limits our right to independently use, develop, evaluate, or market products or services, whether incorporating Feedback or otherwise.</p><h2 id="_13-confidentiality" tabindex="-1">13. Confidentiality. <a class="header-anchor" href="#_13-confidentiality" aria-label="Permalink to &quot;13. Confidentiality.&quot;">​</a></h2><p>13.1. Except as otherwise set forth in this agreement, each party agrees that all code, inventions, know-how and business, technical and financial information disclosed to such party (“Receiving Party”) by the disclosing party (&quot;Disclosing Party&quot;) constitute the confidential property of the Disclosing Party (“Confidential Information”), provided that it is identified as confidential at the time of disclosure or should be reasonably known by the Receiving Party to be confidential or proprietary due to the nature of the information disclosed and the circumstances surrounding the disclosure. Any of Our Technology and any performance information relating to SPACE will be deemed our Confidential Information without any marking or further designation. Except as expressly authorized herein, the Receiving Party will (1) hold in confidence and not disclose any Confidential Information to third parties and (2) not use Confidential Information for any purpose other than fulfilling its obligations and exercising its rights under this agreement. The Receiving Party may disclose Confidential Information to its employees, agents, contractors and other representatives having a legitimate need to know, provided that they are bound to confidentiality obligations no less protective of the Disclosing Party than this Section 13 and that the Receiving Party remains responsible for compliance by them with the terms of this Section 13. The Receiving Party&#39;s confidentiality obligations will not apply to information which the Receiving Party can document: (i) was rightfully in its possession or known to it prior to receipt of the Confidential Information; (ii) is or has become public knowledge through no fault of the Receiving Party; (iii) is rightfully obtained by the Receiving Party from a third party without breach of any confidentiality obligation; or (iv) is independently developed by employees of the Receiving Party who had no access to such information. The Receiving Party may also disclose Confidential Information if so required pursuant to a regulation, law or court order (but only to the minimum extent required to comply with such regulation or order and with advance notice to the Disclosing Party). The Receiving Party acknowledges that disclosure of Confidential Information would cause substantial harm for which damages alone would not be a sufficient remedy, and therefore that upon any such disclosure by the Receiving Party the Disclosing Party will be entitled to appropriate equitable relief in addition to whatever other remedies it might have at law.</p><h2 id="_14-term-and-termination" tabindex="-1">14. Term and Termination. <a class="header-anchor" href="#_14-term-and-termination" aria-label="Permalink to &quot;14. Term and Termination.&quot;">​</a></h2><p>14.1. <span style="text-decoration:underline;">Term</span>. This agreement is effective as of the Effective Date and expires on the date of expiration or termination of all Subscription Terms.</p><p>14.2. <span style="text-decoration:underline;">Termination for Cause</span>. Either party may terminate this agreement (including all related Orders) if the other party (a) fails to cure any material breach of this agreement within thirty (30) days after notice; (b) ceases operation without a successor; or (c) seeks protection under any bankruptcy, receivership, trust deed, creditors’ arrangement, composition or comparable proceeding, or if any such proceeding is instituted against that party (and not dismissed within sixty (60) days thereafter).</p><p>14.3. <span style="text-decoration:underline;">Termination for Convenience</span>. You may choose to stop using SPACE and terminate this agreement (including all Orders) at any time for any reason upon written notice to us. As per Section 9 (Our return policy), upon any such termination (i) you will not be entitled to a refund of any pre-paid fees and (ii) if you have not already paid all applicable fees for the then-current Subscription Term or related services period (as applicable), any such fees that are outstanding will become immediately due and payable.</p><p>14.4. <span style="text-decoration:underline;">Effects of Termination</span>. Upon any expiration or termination of this agreement, you must cease using SPACE.</p><p>14.5. <span style="text-decoration:underline;">Survival</span>. The following provisions will survive any termination or expiration of this agreement: Sections 4.3 (Restrictions), 5.4 (Your Indemnity), 5.1 (Third-Party Products), 8.3 (Payment), 10.1. (Taxes), 12.1 (IP Rights and Feedback), 13.1 (Confidentiality), 14 (Term and Termination), 15.4 (Warranty Disclaimer), 16 (Limitations of Liability), 17 (IP Indemnification) (but solely with respect to claims arising from your use of SPACE during the Subscription Term), 19 (Dispute Resolution) and 22 (General Provisions).</p><h2 id="_15-warranties-and-disclaimer" tabindex="-1">15. Warranties and Disclaimer. <a class="header-anchor" href="#_15-warranties-and-disclaimer" aria-label="Permalink to &quot;15. Warranties and Disclaimer.&quot;">​</a></h2><p>15.1. <span style="text-decoration:underline;">Mutual Warranties</span>. Each party represents and warrants that it has the legal power and authority to enter into this agreement.</p><p>15.2. <span style="text-decoration:underline;">Our Warranties</span>. We warrant, for your benefit only, that we use commercially reasonable efforts to prevent introduction of viruses, Trojan horses or similar harmful materials into SPACE (but we are not responsible for harmful materials submitted by you or End Users) (the “Performance Warranty”).</p><p>15.3. <span style="text-decoration:underline;">Warranty Remedy</span>. We will use commercially reasonable efforts, at no charge to you, to correct reported non-conformities with the Performance Warranty. If we determine corrections to be impracticable, either party may terminate the applicable Subscription Term. In this case, you will receive a refund of any fees you have pre-paid for use of SPACE for the terminated portion of the applicable Subscription Term. The Performance Warranty will not apply: (i) unless you make a claim within thirty (30) days of the date on which you first noticed the non-conformity, (ii) if the non-conformity was caused by misuse, unauthorized modifications or third-party products, software, services or equipment or (iii) to no-charge products. Our sole liability, and your sole and exclusive remedy, for any breach of the Performance Warranty are set forth in this Section 15.</p><p>15.4. WARRANTY DISCLAIMER. EXCEPT AS EXPRESSLY PROVIDED IN THIS SECTION 15, SPACE, SUPPORT AND ADDITIONAL SERVICES ARE PROVIDED “AS IS,” AND WE AND OUR SUPPLIERS EXPRESSLY DISCLAIM ANY AND ALL WARRANTIES AND REPRESENTATIONS OF ANY KIND, INCLUDING ANY WARRANTY OF NON-INFRINGEMENT, TITLE, FITNESS FOR A PARTICULAR PURPOSE, FUNCTIONALITY OR MERCHANTABILITY, WHETHER EXPRESS, IMPLIED OR STATUTORY. WITHOUT LIMITING OUR EXPRESS OBLIGATIONS IN this agreement, WE DO NOT WARRANT THAT YOUR USE OF SPACE WILL BE UNINTERRUPTED OR ERROR-FREE, THAT WE WILL REVIEW YOUR DATA FOR ACCURACY OR THAT WE WILL PRESERVE OR MAINTAIN YOUR DATA WITHOUT LOSS. YOU UNDERSTAND THAT USE OF SPACE NECESSARILY INVOLVES TRANSMISSION OF YOUR DATA OVER NETWORKS THAT WE DO NOT OWN, OPERATE OR CONTROL, AND WE ARE NOT RESPONSIBLE FOR ANY OF YOUR DATA LOST, ALTERED, INTERCEPTED OR STORED ACROSS SUCH NETWORKS. WE CANNOT GUARANTEE THAT OUR SECURITY PROCEDURES WILL BE ERROR-FREE, THAT TRANSMISSIONS OF YOUR DATA WILL ALWAYS BE SECURE OR THAT UNAUTHORIZED THIRD PARTIES WILL NEVER BE ABLE TO DEFEAT OUR SECURITY MEASURES OR THOSE OF OUR THIRD PARTY SERVICE PROVIDERS. WE WILL NOT BE LIABLE FOR DELAYS, INTERRUPTIONS, SERVICE FAILURES OR OTHER PROBLEMS INHERENT IN USE OF THE INTERNET AND ELECTRONIC COMMUNICATIONS OR OTHER SYSTEMS OUTSIDE OUR REASONABLE CONTROL. YOU MAY HAVE OTHER STATUTORY RIGHTS, BUT THE DURATION OF STATUTORILY REQUIRED WARRANTIES, IF ANY, WILL BE LIMITED TO THE SHORTEST PERIOD PERMITTED BY LAW.</p><h2 id="_16-limitation-of-liability" tabindex="-1">16. Limitation of Liability. <a class="header-anchor" href="#_16-limitation-of-liability" aria-label="Permalink to &quot;16. Limitation of Liability.&quot;">​</a></h2><p>16.1. <span style="text-decoration:underline;">Consequential Damages Waiver</span>. EXCEPT FOR EXCLUDED CLAIMS (AS DEFINED BELOW), NEITHER PARTY (NOR ITS SUPPLIERS) WILL HAVE ANY LIABILITY ARISING OUT OF OR RELATED TO THIS AGREEMENT FOR ANY LOSS OF USE, LOST OR INACCURATE DATA, LOST PROFITS, FAILURE OF SECURITY MECHANISMS, INTERRUPTION OF BUSINESS, COSTS OF DELAY, OR ANY INDIRECT, SPECIAL, INCIDENTAL, RELIANCE OR CONSEQUENTIAL DAMAGES OF ANY KIND, EVEN IF INFORMED OF THE POSSIBILITY OF SUCH DAMAGES IN ADVANCE.</p><p>16.2. <span style="text-decoration:underline;">Liability Cap</span>. EXCEPT FOR EXCLUDED CLAIMS, EACH PARTY’S AND ITS SUPPLIERS’ AGGREGATE LIABILITY TO THE OTHER ARISING OUT OF OR RELATED TO this agreement WILL NOT EXCEED THE AMOUNT ACTUALLY PAID OR PAYABLE BY YOU TO US UNDER this agreement IN THE TWELVE (12) MONTHS IMMEDIATELY PRECEDING THE CLAIM.</p><p>16.3. <span style="text-decoration:underline;">Excluded Claims</span>. “Excluded Claims” means (1) amounts owed by you under any Orders, (2) either party’s express indemnification obligations in this agreement, and (3) your breach of Section 3.3 (Restrictions).</p><p>16.4. <span style="text-decoration:underline;">Nature of Claims and Failure of Essential Purpose</span>. The parties agree that the waivers and limitations specified in this Section 16 apply regardless of the form of action, whether in contract, tort (including negligence), strict liability or otherwise and will survive and apply even if any limited remedy specified in this agreement is found to have failed of its essential purpose.</p><h2 id="_17-ip-indemnification" tabindex="-1">17. IP Indemnification. <a class="header-anchor" href="#_17-ip-indemnification" aria-label="Permalink to &quot;17. IP Indemnification.&quot;">​</a></h2><p>We will defend you against any claim brought against you by a third party alleging that SPACE, when used as authorized under this agreement, infringe any third-party patent, copyright or trademark, or misappropriate any third-party trade secret enforceable in any jurisdiction that is a signatory to the Berne Convention (a “Claim”), and we will indemnify you and hold you harmless against any damages and costs finally awarded on the Claim by a court of competent jurisdiction or agreed to via settlement executed by us (including reasonable attorneys’ fees), provided that we have received from you: (a) prompt written notice of the Claim (but in any event notice in sufficient time for us to respond without prejudice); (b) reasonable assistance in the defense and investigation of the Claim, including providing us a copy of the Claim, all relevant evidence in your possession, custody, or control, and cooperation with evidentiary discovery, litigation, and trial, including making witnesses within your employ or control available for testimony; and (c) the exclusive right to control and direct the investigation, defense, and settlement (if applicable) of the Claim. If your use of SPACE is (or in your opinion is likely to be) enjoined, whether by court order or by settlement, or if we determine such actions are reasonably necessary to avoid material liability, we may, at our option and in our discretion: (i) procure the right for your continued use of SPACE in accordance with this agreement; or (ii) terminate your right to continue using SPACE and refund any prepaid amounts for the terminated portion of the Subscription Term.</p><p>THIS SECTION 17 (IP INDEMNIFICATION) STATES OUR SOLE LIABILITY AND YOUR EXCLUSIVE REMEDY FOR ANY INFRINGEMENT OF INTELLECTUAL PROPERTY RIGHTS IN CONNECTION WITH ANY CLOUD PRODUCT OR OTHER ITEMS WE PROVIDE UNDER THIS AGREEMENT.</p><h2 id="_18-publicity-rights" tabindex="-1">18. Publicity Rights. <a class="header-anchor" href="#_18-publicity-rights" aria-label="Permalink to &quot;18. Publicity Rights.&quot;">​</a></h2><p>18.1 We may identify you as a Succeedium or SPACE customer in our promotional materials. We will promptly stop doing so upon your request sent to <a href="mailto:info@succeedium.com" target="_blank" rel="noreferrer">info@succeedium.com</a>.</p><h2 id="_19-dispute-resolution" tabindex="-1">19. Dispute Resolution. <a class="header-anchor" href="#_19-dispute-resolution" aria-label="Permalink to &quot;19. Dispute Resolution.&quot;">​</a></h2><p>19.1. <span style="text-decoration:underline;">Informal Resolution</span>. In the event of any controversy or claim arising out of or relating to this agreement, the parties will consult and negotiate with each other and, recognizing their mutual interests, attempt to reach a solution satisfactory to both parties. If the parties do not reach settlement within a period of sixty (60) days, either party may pursue relief as may be available under this agreement pursuant to Section 19.2 (Governing Law; Jurisdiction). All negotiations pursuant to this Section 19.1 will be confidential and treated as compromise and settlement negotiations for purposes of all rules and codes of evidence of applicable legislation and jurisdictions.</p><p>19.2. <span style="text-decoration:underline;">Governing Law; Jurisdiction</span>. This Agreement shall be governed by and construed in accordance with the laws of Ontario and the laws of Canada applicable therein. Any and all disputes arising under this Registration Rights Agreement, whether as to interpretation, performance or otherwise, shall be subject to the exclusive jurisdiction of the courts of the Province of Ontario and each of the parties hereto hereby irrevocably attorns to the jurisdiction of the courts of such province. In any action or proceeding to enforce a party’s rights under this agreement, the prevailing party will be entitled to recover its reasonable costs and attorneys’ fees.</p><p>19.3. <span style="text-decoration:underline;">Injunctive Relief; Enforcement</span>. Notwithstanding the provisions of Section 19.1 (Informal Resolution) and 19.2 (Governing Law; Jurisdiction), nothing in this agreement will prevent us from seeking injunctive relief with respect to a violation of intellectual property rights, confidentiality obligations or enforcement or recognition of any award or order in any appropriate jurisdiction.</p><h2 id="_20-changes-to-this-agreement" tabindex="-1">20. Changes to this agreement. <a class="header-anchor" href="#_20-changes-to-this-agreement" aria-label="Permalink to &quot;20. Changes to this agreement.&quot;">​</a></h2><p>20.1. We may modify the terms and conditions of this agreement (including Our Policies) from time to time, with notice to you in accordance with Section 22.1 (Notices) or by posting the modified agreement on our website. Together with notice, we will specify the effective date of the modifications.</p><p>20.2. Except as otherwise indicated below, modifications to this agreement will take effect at the next renewal of your Subscription Term and will automatically apply as of the renewal date unless you elect not to renew pursuant to Section 8.2 (Renewals). Notwithstanding the foregoing, in some cases (e.g., to address compliance with Laws, or as necessary for new features) we may specify that such modifications become effective during your then-current Subscription Term. If the effective date of such modifications is during your then-current Subscription Term and you object to the modifications, then (as your exclusive remedy) you may terminate your affected Orders upon notice to us, and we will refund you any fees you have pre-paid for use of SPACE for the terminated portion of the applicable Subscription Term. To exercise this right, you must provide us with notice of your objection and termination within thirty (30) days of us providing notice of the modifications. For the avoidance of doubt, any Order is subject to the version of this agreement in effect at the time of the Order.</p><p>20.3. We may modify Our Policies to take effect during your then-current Subscription Term in order to respond to changes in our products, our business, or Laws. In this case, unless required by Laws, we agree not to make modifications to Our Policies that, considered as a whole, would substantially diminish our obligations during your then-current Subscription Term. Modifications to Our Policies will take effect automatically as of the effective date specified for the updated policies.</p><h2 id="_21-changes-to-space" tabindex="-1">21. Changes to SPACE. <a class="header-anchor" href="#_21-changes-to-space" aria-label="Permalink to &quot;21. Changes to SPACE.&quot;">​</a></h2><p>21.1. You acknowledge that SPACE is an on-line, subscription-based product, and that in order to provide improved customer experience we may make changes to SPACE, and we may update the applicable Documentation accordingly. Subject to our obligation to provide SPACE and Additional Services under existing Orders, we can discontinue any portion or feature of SPACE for any reason at any time without liability to you.</p><h2 id="_22-general-provisions" tabindex="-1">22. General Provisions. <a class="header-anchor" href="#_22-general-provisions" aria-label="Permalink to &quot;22. General Provisions.&quot;">​</a></h2><p>22.1. <span style="text-decoration:underline;">Notices</span>. Any notice under this agreement must be given in writing. We may provide notice to you through your Notification Email Address, your account or in-product notifications. You agree that any electronic communication will satisfy any applicable legal communication requirements, including that such communications be in writing. Any notice to you will be deemed given upon the first business day after we send it. You will provide notice to us electronically by contacting us at <a href="mailto:space@succeedium.com" target="_blank" rel="noreferrer">space@succeedium.com</a>. Your notices to us will be deemed given upon receipt.</p><p>22.2. <span style="text-decoration:underline;">Force Majeure</span>. Neither party will be liable to the other for any delay or failure to perform any obligation under this agreement (except for a failure to pay fees) if the delay or failure is due to events which are beyond the reasonable control of such party, such as a strike, blockade, war, act of terrorism, riot, natural disaster, failure or diminishment of power or telecommunications or data networks or services, or refusal of a license by a government agency.</p><p>22.3. <span style="text-decoration:underline;">Assignment</span>. You may not assign or transfer this agreement without our prior written consent. As an exception to the foregoing, you may assign this agreement in their entirety (including all Orders) to your successor resulting from a merger, acquisition, or sale of all or substantially all of your assets or voting securities, provided that you provide us with prompt written notice of the assignment and the assignee agrees in writing to assume all of your obligations under this agreement. Any attempt by you to transfer or assign this agreement except as expressly authorized above will be null and void. We may assign our rights and obligations under this agreement (in whole or in part) without your consent. We may also permit our Affiliates, agents and contractors to exercise our rights or perform our obligations under this agreement, in which case we will remain responsible for their compliance with this agreement. Subject to the foregoing, this agreement will inure to the parties’ permitted successors and assigns.</p><p>22.4. <span style="text-decoration:underline;">Entire Agreement</span>. this agreement are the entire agreement between you and us relating to SPACE and any other subject matter covered by this agreement, and supersede all prior or contemporaneous oral or written communications, proposals and representations between you and us with respect to SPACE or any other subject matter covered by this agreement. No provision of any purchase order or other business form employed by you will supersede or supplement the terms and conditions of this agreement, and any such document relating to this agreement will be for administrative purposes only and will have no legal effect.</p><p>22.5. <span style="text-decoration:underline;">Conflicts</span>. In event of any conflict between the main body of this agreement and Our Policies, Our Policies (as applicable) will control with respect to their subject matter.</p><p>22.6. <span style="text-decoration:underline;">Waivers; Modifications</span>. No failure or delay by the injured party to this agreement in exercising any right, power or privilege hereunder will operate as a waiver thereof, nor will any single or partial exercise thereof preclude any other or further exercise thereof or the exercise of any right, power or privilege hereunder at law or equity. Except as set forth in Section 20 (Changes to this agreement), any amendments or modifications to this agreement must be executed in writing by an authorized representative of each party.</p><p>22.7. <span style="text-decoration:underline;">Interpretation</span>. As used herein, “including” (and its variants) means “including without limitation” (and its variants). Headings are for convenience only. If any provision of this agreement is held to be void, invalid, unenforceable or illegal, the other provisions will continue in full force and effect.</p>',112),r=[n];function s(l,d,c,u,h,p){return t(),i("div",null,r)}const f=e(o,[["render",s]]);export{m as __pageData,f as default};
